import React, { Component } from 'react';
import '../App.css';

export default class NewsBody extends Component {

    render() {
        const { news } = this.props;
        return(
            <div className="NewsBody">
                <div className="newsbody-container">
                    <div className="newsbody-post">
                        {news.map((item) => {
                            return(
                                <div className="newsbody-big">
                                    <div className="newsbody-big-img"></div>
                                    <div className="newsbody-big-time">{item.time}</div>
                                    <div className="newsbody-big-title">item</div>
                                    <div className="newsbody-big-content">Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deseru mollit anim idâ€¦</div>
                                    <div className="newsbody-big-link">Read More</div>
                                </div>
                            )
                        })}
                        <div className="newsbody-small">small</div>
                    </div>
                    <div className="newsbody-nav">
                        <div className="newsbody-search">search</div>
                        <div className="newsbody-pop">popular</div>
                        <div className="newsbody-cate">category</div>
                        <div className="newsbody-tag">TAg</div>
                    </div>
                </div>
            </div>
        )
    }
}
